      return(props.num)    
        
       
     
    
}
const Show= ()=>{
  function checkIfElementPresent(array , element) {
    for(let i = 0, len = array.length; i < len; i++){
      if(array[i] === element){
         return true;
      }
    }
    return false
  }
  let key=0;
  const norepeat=[];
  while(key<15){
    let ran = Math.floor((Math.random() * 15) );
    if(checkIfElementPresent(norepeat,ran)){
      continue;
  }
  norepeat.push(ran);
   return( <Display num={ran}/>)
  key++;       
} 
}



     const  Displayframe = ()=>{
          
    const words =[	
       "あ","い","う","え","お",
       "か","き","く","け","こ" ,
       "さ","し","す","せ","そ"];
    
     return(
        <>
        setTimeout(() => {
          <Show />
        },2000);


  <p> {words[0]}</p>
  </>
  )
}
